import React from "react";
import styled from "styled-components";
import Slogao_Template from "Slogan_Template";

const MainBlock = styled.div`
  width: 100vw; // %로 하면 오류가 뜨는데 이유 찾아보기.
  height: 100vh;
  background: #e6e6e6;
`;

function Main() {
  return <MainBlock></MainBlock>;
}

export default Main;
